import React from 'react';

const AboutSection = () => {
  return (
    <div className='section about'>
      <a className='arrow-big'>
        <p className='arrow-big__title'>About me</p>
      </a>
      <div className='about__text-box-1'></div>
      <p className=' paragraph-big'>NPTU computer science</p>
      <div className='about__text-box-2'>
        <p className='paragraph-medium'>
          正正在學習如何正在學習如何寫網站的學生
        </p>
        <p className='paragraph-medium'>專長：Reactjs /Reduxjs /Nodejs</p>
      </div>
      <div className='about__project-box'>
        <div className='project__title'></div>
        <div className='project__content'>
          <a className='project__item'>onlene-store</a>
          <a className='project__item'>dev-social-network-community</a>
        </div>
      </div>
    </div>
  );
};

export default AboutSection;
